//Open/close category filter on desktop on the search page

function openCloseFilter(id, p) {
	
					var m = $("#"+id);
					var o = $("#"+id.substring(0, id.length - 8)+"-header");
					var n = $("#"+id.substring(0, id.length - 8)+"-header > i");
					var r = $("#"+id.substring(0, id.length - 8)+"-footer");
					var s = $("#"+id.substring(0, id.length - 8)+"-content");
					
					if (m.is(":visible")) {
						m.slideUp();
						if (p == 'startsWithDown') { 
							o.html('LEARN MORE<i class="fa fa-chevron-down"></i>');
						}
						else {
							n.switchClass( "fa-chevron-down", "fa-chevron-up");
							r.animate({backgroundColor:'white'}, 200);
							r.html('OPEN FILTER');
							n.animate({color:'#000;'}, 200);
							o.animate({color:'#000;', backgroundColor:'white'}, 200);
						};
						
						
						
					} else {
						m.slideDown();
						if (p == 'startsWithDown') { 
							o.html('CLOSE <i class="fa fa-chevron-up"></i>');
						}
						else {
							n.switchClass( "fa-chevron-up", "fa-chevron-down");
							o.animate({color:'#16aace;', backgroundColor:'#eeeeee'}, 200);
							r.animate({backgroundColor:'#eeeeee'}, 200);
							r.html('CLOSE FILTER');
							n.animate({color:'#16aace;'}, 200);
						};
						
						
					};
}

